window.bookSummaryJSON = "<p><b>A single car crash changes the world as we know it in this immersive audio experience.</b></p> <p>Loretta Pacheco has a cool job at an electric car company. Her life finally seems headed in the right direction.</p> <p>But in a flash, it all starts to fall apart.</p> <p>What were the strange voices she heard as she lay injured by the side of the road? Why, exactly, did two young boys disappear all those years ago? And what is this strange sound in her head?</p> <p>Lorettaâ€™s determined to uncover the truth. But whose truth is it? And why are the people closest to her suddenly not who they seem to be?</p> <p><i>Eminent Domain </i>is a full-cast science fiction drama, recorded on location in New Mexico.</p> <p><b>NOTE: For an enhanced listening experience, headphones are recommended. </b></p> <p>Full cast of narrators includes: Tiger Phillips, Tasneem Bsais, Emily Rankin, Shawn Boyd, Chris Eide, Morgan Pollitt, Evan Langford, and Warren Langford.</p>"; 
